import React from 'react';





const App = ()=>{
    return(
<>
 <div className="main_div">
<div className="center_div">
<br/>
<h1>to do list</h1>
<br/>
<input type="text" placeholder="to do list" onChange={itemEvent} />
<button>+</button>
<ol>
    <li>buy a apple</li>
</ol>
</div>
 </div>

</>
    )
};


export default App;
